import React from 'react'
import { GiFirePunch } from 'react-icons/gi'




export async function getServerSideProps() {
    const data = await fetch(`http://localhost:8000/products`)
    const prod = await data.json()

    if (!data) {
        return { notFound: true, }
    }

    return { props: { prod } }
}

function test({ prod }) {
    return (
        <div>
            { console.log(prod)}

            <h2 className="text-3xl text-white"> yesjjjej</h2>
        </div>
    )
}

export default test
